import './rightbar.css'
import {Users} from '../../dummyData'
import Online from '../online/Online'

export default function Rightbar({profile}) {

    const HomeRightbar = () =>{
        return (
            <>
                 <div className="bdContainer">
                    <img src="assets/gift.png" alt="" className="bdImg" />
                    <span className="bdText">
                        <b>Mawar Melati</b> dan <b>3 teman lainnya</b> ulang tahun hari ini
                    </span>
                </div>
                <img className="sponsor" src="assets/ad.png" alt=""  />
                <h4 className="rightTitle">Kontak</h4>
                <ul className="friendList">
                   {Users.map(i=>(
                       <Online key={i.id} user={i}/>
                   ))}
                </ul>
            </>
        )
    }
    const ProfileRightbar = ()=>{
        return(<h1>profile</h1>)
    }
    return (
        <div className="rightContainer">
            <div className="rightWrapper">

            </div>
        </div>
    )
}
